import React from 'react';

const Login = () => {
    return (
        <div className="bg-white w-full min-h-screen flex items-center justify-center px-4">
        <div className="login-screen w-full max-w-6xl flex items-start min-h-3/4">
          {/* Div Azul */}
          <div className="relative w-3/5 h-full flex flex-col bg-blue-500 p-12">
            <h1 className="text-white">Div Azul</h1>
          </div>
  
          {/* Div Branca */}
          <div className="relative w-2/5 h-full flex flex-col bg-white p-12">
            <h1 className="text-black">Div Branca</h1>
          </div>
        </div>
      </div>
    );
};



export default Login;
